import React from "react";
import "./Navigation.css";

const Navigation = () => {
    return (
        <nav>
            <div className="welcome">
                Savings Calculator by John Bender
            </div>
            <div className="about">
                About
            </div>
        </nav>
    )
}

export default Navigation;
